@charlton2142: wrong.
@diskmedeedal: wrong.

Numbering was right with the double (episodes 11 and 12) however, subsequent episodes were numbered incorrectly as episodes 12 and 13.  These two episodes were in-fact episodes 13 and 14 (respectively).  This episode is actual episode 15 (or at least, is said to be actual episode 15, but I am yet to check).

A few comments about this have been made on the episode 13 and 14 downloads (incorrectly labelled 12 and 13 respectively) and is mentioned by "BoonesFerry" but not in so many words.
